import React from 'react';
import './DiningOptionsPage.css'; 
import { FaCoffee, FaUtensils, FaCocktail, FaPizzaSlice, FaHamburger } from 'react-icons/fa';  // Adding icons
import MyFooter from '../../components/Footer/MyFooter'

const diningOptionsData = [
  {
    id: 1,
    name: 'The Gourmet Restaurant',
    description: 'Fine dining experience with international cuisine.',
    hours: '6 PM - 11 PM',
    menuHighlights: 'Grilled Salmon, Filet Mignon, Vegan Pasta',
    imageUrl: 'data:image/jpeg;base64,',
    icon: <FaUtensils />,  // Icon for fine dining
  },
  {
    id: 2,
    name: 'The Cozy Cafe',
    description: 'A casual cafe serving coffee and light bites.',
    hours: '8 AM - 6 PM',
    menuHighlights: 'Espresso, Croissants, Sandwiches',
    imageUrl: 'data:image/jpeg;base64,',
    icon: <FaCoffee />,  // Icon for cafe
  },
  {
    id: 3,
    name: 'The Pool Bar',
    description: 'Relaxing bar by the pool with refreshing cocktails.',
    hours: '10 AM - 10 PM',
    menuHighlights: 'Mojitos, Nachos, Fruit Smoothies',
    imageUrl: 'data:image/jpeg;base64,',
    icon: <FaCocktail />,  // Icon for pool bar
  },
  {
    id: 4,
    name: 'Pizzeria Italia',
    description: 'Traditional wood-fired pizza with fresh ingredients.',
    hours: '12 PM - 10 PM',
    menuHighlights: 'Margherita Pizza, Pepperoni, Veggie Pizza',
    imageUrl: 'data:image/jpeg;base64,',
    icon: <FaPizzaSlice />,  // Icon for pizza restaurant
  },
  {
    id: 5,
    name: 'Burger Haven',
    description: 'Gourmet burgers and sides with a variety of sauces.',
    hours: '11 AM - 9 PM',
    menuHighlights: 'Cheeseburger, BBQ Bacon Burger, Veggie Burger',
    imageUrl: 'data:image/png;base64,',
    icon: <FaHamburger />,  // Icon for burger restaurant
  },
];

const DiningOptionsPage = () => {
  return (
    <div className="dining-options-container">
      <h1>Dining Options</h1>
      <p>Experience a variety of dining options during your stay.</p>
      <div className="dining-options-list">
        {diningOptionsData.map(option => (
          <div key={option.id} className="dining-option-card">
            <img src={option.imageUrl} alt={option.name} className="dining-option-image" />
            <div className="dining-option-header">
              <h2>{option.name}</h2>
              <div className="dining-option-icon">{option.icon}</div>  {/* Display icon */}
            </div>
            <p>{option.description}</p>
            <p><strong>Opening Hours:</strong> {option.hours}</p>
            <p><strong>Menu Highlights:</strong> {option.menuHighlights}</p>
            <button className="reservation-button">Make a Reservation</button>
          </div>
        ))}
      </div>
      <MyFooter/>
    </div>
  );
};

export default DiningOptionsPage;
